/* eslint-disable array-callback-return */
/* eslint-disable no-console */
/* eslint-disable prettier/prettier */
/* eslint-disable react/prop-types */
import styles from './profile.module.css';

import React from 'react';

import { Link, useParams } from 'react-router-dom';

function Profile({ users }) {
  console.log(users);
  const { uuid } = useParams();
  console.log(uuid);

  return (
    <div className={styles.user}>
      {users.filter(user => user.login.uuid === uuid).map(userProfile => (
        <>
          <div className={styles.container}>
            <div className={styles.rightTopWrapOne}>
              <div>

              </div>
              <div className={styles.rightTopTwo}>
                <strong className={styles.labels}>City:</strong>
                {' '}
                {userProfile.location.city}
              </div>
              <div className={styles.rightTopThree}>
                <strong className={styles.labels}>State:</strong>
                {' '}
                {userProfile.location.state}
              </div>
            </div>
            <div className={styles.leftTopImg}>
              <img src={userProfile.picture.large} alt={userProfile.name.first} />
            </div>
            <div className={styles.rightBottomOne}>
              <strong className={styles.labels}>Zip Code:</strong>
              {' '}
              {userProfile.location.postcode}
            </div>
            <div className={styles.rightBottomTwo}>
              <strong className={styles.labels}>Country:</strong>
              {' '}
              {userProfile.location.country}
            </div>
            <div className={styles.rightBottomThree}>
              <strong className={styles.labels}>Email Address:</strong>
              {' '}
              {userProfile.email}
            </div>
            <div className={styles.rightBottomFour}>
              <strong className={styles.labels}>Joined On:</strong>
              {' '}
              {userProfile.registered.date}
            </div>
            <div className={styles.leftBottomOne}>
              <strong className={styles.labels}>Name:</strong>
              {' '}
              {userProfile.name.first}
              {' '}
              {userProfile.name.last}
            </div>
            <div className={styles.leftBottomTwo}>
              <strong className={styles.labels}>Username:</strong>
              {' '}
              {userProfile.login.username}
            </div>
            <div className={styles.leftBottomThree}>
              <strong className={styles.labels}>Phone Number:</strong>
              {' '}
              {userProfile.phone}
            </div>
            <div className={styles.leftBottomFour}>
              <strong className={styles.labels}>Cell Number:</strong>
              {' '}
              {userProfile.cell}
            </div>
          </div>
          <Link to="/users" className={styles.navButton}>
            Back to Users
          </Link>
        </>
      ))}
    </div>
  );
}

export default Profile;
